import React from 'react';
import fixtures from '../apis/fixtures';

class App extends React.Component {
    constructor(props) {
        super(props);

        this.state = { fixtures: [1, 2, 3] }

        fixtures.get().then((res) => {
            this.setState({ fixtures: res.data.api.fixtures });
        }).catch(function (error) {
            console.log(error);
        });
    }

    render() { 
        const { fixtures } = this.state;

        return(
            fixtures.map(fixture => { return (
                <div>{fixture.referee}</div>
            )}
            )
        )  
    }
}

export default App;
